// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract TestTemp {
    uint256 public a = 100;
    function resetA() public {
        delete a;
    }
    receive() external payable {
        // a = 200;
    }
    fallback() external payable {
        // a = 300;
    }
}
contract Test {
    TestTemp test;
    constructor(address payable _test) payable {
        // _test 必须是一个 payable 地址，否则会编译错误
        // TypeError: Explicit type conversion not allowed from non-payable "address" to "contract TestTemp", which has a payable fallback function.
        // 类型错误：不允许从非支付地址"address"显式类型转换为具有可支付回退函数的合约"TestTemp"。
        test = TestTemp(_test);
    }
    // transfer()，转入0个eth，会触发 TestTemp 合约的 receive() 函数。
    function payH() public payable returns(bool) {
        payable(address(test)).transfer(0 ether);   // 从钱包余额支付，调用时传入，非从合约余额支付
        return (true);
    }
    // transfer()，转入2个eth，会触发 TestTemp 合约的 receive() 函数，前提是钱包余额有足够的eth支付。
    function payI() public payable returns(bool) {
        payable(address(test)).transfer(2 ether);   // 从钱包余额支付，调用时传入，非从合约余额支付
        return (true);
    }

}

